import styled from 'styled-components';
import Footer from '../../footer/Footer';
import Body from './body/Body';
import Nav from '../../nav/Nav';

StyledContainer = styled.div`
    filter:blur(2px);

`
const HomePage = () => {
    return (
        <div>
            <Nav/>
            <Body/>
            <Footer/>
        </div>
    )
}
export default HomePage;
